import { Container } from './styled'
import 'semantic-ui-css/semantic.min.css'


class CrudFuncionarios extends Component {


  render() {
    return (
      <Container>
        <div class="ui divided three column grid"><div class="row"><div class="column"><img src="/images/wireframe/media-paragraph.png" class="ui image" /></div><div class="column"><img src="/images/wireframe/media-paragraph.png" class="ui image" /></div><div class="column"><img src="/images/wireframe/media-paragraph.png" class="ui image" /></div></div><div class="row"><div class="column"><img src="/images/wireframe/media-paragraph.png" class="ui image" /></div><div class="column"><img src="/images/wireframe/media-paragraph.png" class="ui image" /></div><div class="column"><img src="/images/wireframe/media-paragraph.png" class="ui image" /></div></div></div>
      </Container>
    );
  }
}

export default CrudFuncionarios;
